  public Object d; 

  public Elem(Object dd, Elem nn) { 
    n = nn; 
    d = dd; 
  } 
} 

public class Structure { 

  private Elem f = new Elem(null, null); 
  private int s = 0; 

  public void add(Object obj, int pos) { 
    Elem t = getTo(pos - 1); 
    t.n = new Elem(obj, t.n); 
    s++; 
  } 

  public void remove(int pos) { 
    Elem t = getTo(pos - 1); 
    t.n = t.n.n; 
    s--; 
  } 

  public Object get(int pos) { 
    return getTo(pos).d; 
  } 

  public int size() { 
    return s; 
  } 

  public Elem getTo(int pos) { 
    Elem t = f; 
    for(int i = 0; i < pos; i++, t = t.n); 
    return t; 
  } 
} 
